function ezwaktu_solat_install () {
    global $wpdb;

    $table_waktuSolat = $wpdb->prefix . "waktusolat2";
    $table_kodKawasan = $wpdb->prefix . "waktusolatkod2";

    if($wpdb->get_var("show tables like '$table_waktuSolat'") != $table_waktuSolat) {
          
        $sql = "CREATE TABLE " . $table_waktuSolat . " (
              `Kod` varchar(255) NOT NULL,
              `Tarikh` varchar(50) NOT NULL,
              `Hari` varchar(10) NOT NULL,
              `Imsak` varchar(20) NOT NULL,
              `Subuh` varchar(20) NOT NULL,
              `Syuruk` varchar(20) NOT NULL,
              `Zuhur` varchar(20) NOT NULL,
              `Asar` varchar(20) NOT NULL,
              `Maghrib` varchar(20) NOT NULL,
              `Isyak` varchar(20) NOT NULL
            );";

        require_once(ABSPATH . 'wp-admin/includes/upgrade.php');
        dbDelta($sql);

        $senaraiData = ezws_waktu_solat();

        foreach ($senaraiData as $data) {           
            $rows_affected[] = $wpdb->insert( $table_waktuSolat, $data );
        }
     
        add_option("ez_waktu_solat_db_version", "1.0");

    }

    if($wpdb->get_var("show tables like '$table_kodKawasan'") != $table_kodKawasan) {
          
        $sql = "CREATE TABLE " . $table_kodKawasan . " (
            Kod varchar(10) NOT NULL,
            Nama varchar(150) NOT NULL
            );";

        require_once(ABSPATH . 'wp-admin/includes/upgrade.php');
        dbDelta($sql);

        $kodKawasan = ezws_waktu_solat_kod();

        foreach ($kodKawasan as $kaw) {           
            $rows_affected[] = $wpdb->insert( $table_kodKawasan, $kaw );
        }
     
        add_option("ez_waktu_solat_kod_db_version", "1.0");

    }

}

